css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://digitalplace.nl/forum/") {
  body {
    background-image: url('data:image/gif;base64,%3D%3D') !important;
    background-repeat: repeat-x !important;
  }

  #main_body {
     width: 90% !important;
  }

  #top_part_image,
    .middle_content_body,
    #page-body,
    #main_menu_bg,
    #top_part,
    #content_body,
    #inner_content_body,
    .small_box {
     width: 100% !important;
  }

  #main_menu {
    margin: 0 auto auto !important;
  }

  #main_menu_body {
    background-image: url('data:image/gif;base64,%3D') !important;
  }

  #main_menu_bg {
    background-image: none !important;
    background-color: #e1e1e1 !important;
  }

  .menu_links li {
    float: none !important;
    display: inline !important;
  }

  .menu_links {
    text-align: center !important;
  }

  #footer {
    width: 920px !important;
    margin: 0 auto auto !important;
  }
}
